import React from "react";
import { useState } from "react";
import { useEffect } from "react";
import ConnectMetamask from "../ADSTR/ConnectMetamask";
import ConnectContractSR from "./ConnectContractSR";
let account="0x85e19d642d24fe428Eb9205F077a856CA8bC95B0";

export default function DIVISIONReceivedReq() {
    const [res, setRes] = useState([]);
    ConnectMetamask();
    ConnectContractSR();
    const sendadsts=async(row)=>{
        console.log(row);
            let adst="";
            let ref1="";
            let ref2="";

            for(let i=0;i<row.from.length;i++){
                if(i>1){
                    ref2+=row.from[i];
                }
                else{
                    ref1+=row.from[i];
                }
            }
            console.log(ref1,ref2);
            if(ref2==="ADST1"){
              await  window.contract.methods.adstReceived([ref1+"ADST2"],row.requestno,localStorage.getItem("ROLENAME"),row.from,row.product,row.quantity,row.date).send({from:account});

                
            }
            if(ref2==="ADST2"){
              await window.contract.methods.adstReceived([ref1+"ADST1"],row.requestno,localStorage.getItem("ROLENAME"),row.from,row.product,row.quantity,row.date).send({from:account});
            } 
    }
    useEffect(() => {
        const fetchdata = async () => {
            let res = await window.contract.methods
                .getallreqreceivedddst(localStorage.getItem("ROLENAME"))
                .call();

            let res2 = await window.contract1.methods
                .getallreqreceivedddst(localStorage.getItem("ROLENAME"))
                .call();

            let updated = [...res];
            for (let i = 0; i < res2.length; i++) {
                for (let j = 0; j < updated.length; j++) {
                    if (
                        updated[j].reqno === res2[i].reqno &&
                        updated[j].from === res2[i].from
                    ) {
                        updated[j] = res2[i];
                    }
                }
            }
            if (updated.length === 0) {
                updated = [...res2];
            }

            setRes(updated);
            for (let i = 0; i < updated.length; i++) {
                if (updated[i].reqfrom.length === 7) {
                    if (updated[i].acceptedby === "No supplies in units") {
                        // table.row.add({'requestno':res[i].reqno,'from':res[i].from,'product':res[i].products,'quantity':res[i].quantities,'date':res[i].date,'sendtoadsts':"NA",'sentasc':"<button class='btn btn-dark send-dgst'>Send to DGST</button>"}).draw();
                    }

                    if (updated[i].status === "pending") {
                        // console.log("HI");
                        // table.row.add({'requestno':res[i].reqno,'from':res[i].from,'product':res[i].products,'quantity':res[i].quantities,'date':res[i].date,'sendtoadsts':"<button class='btn btn-dark send-adsts'>Send to adsts</button>",'sentasc':"NA"}).draw();
                    }
                } else {
                    if (updated[i].status === "pending") {
                        // console.log(updated[i].reqfrom);
                        // table.row.add({'requestno':res[i].reqno,'from':res[i].from,'product':res[i].products,'quantity':res[i].quantities,'date':res[i].date,'sendtoadsts':"<button class='btn btn-dark send-alladsts'>Send to adsts</button>",'sentasc':"NA"}).draw();
                    }
                }
            }
        };
        fetchdata();
    });
    return (
        <>

            <div className="container" >
                {res}
                <table className="table table-striped table-hover" id="myTable">
                    <thead>
                        <tr>
                            <th>Request no</th>
                            <th>Request from</th>
                            <th>Products</th>
                            <th>Quantities</th>
                            <th>Date</th>
                            <th>send to adst</th>
                            <th>send to dgst</th>
                        </tr>
                    </thead>
                    <tbody>
                        {res.map((row, i) => {
                            if (row.status === "pending") {
                                return (
                                    <tr key={i}>
                                        <td>{parseInt(row.reqno)}</td>
                                        <td>{row.reqfrom}</td>
                                        <td>{row.products}</td>
                                        <td>{row.quantities}</td>
                                        <td>{row.date}</td>
                                        <td>
                                            {row.reqfrom.length === 7 && row.acceptedby === "No supplies in units" && (
                                                <p>na</p>
                                            )}
                                            {row.reqfrom.length === 7 && row.status === "pending" && (
                                                <button onClick={() => sendadsts(row)} >Send to adsts</button>
                                            )}
                                            {row.reqfrom.length !== 7 && row.status === "pending" && (
                                                <button>Send all adsts</button>
                                            )}
                                        </td>
                                        <td>
                                            {row.reqfrom.length === 7 && row.acceptedby === "No supplies in units" && (
                                                <button>Send to dgst</button>
                                            )}
                                            {row.reqfrom.length === 7 && row.status === "pending" && (
                                                <p>na</p>
                                            )}
                                            {row.reqfrom.length !== 7 && row.status === "pending" && (
                                                <p>na</p>
                                            )}
                                        </td>
                                        
                                    </tr>
                                );
                            } else {
                                return null;
                            }
                        })}

                    </tbody>
                </table>

            </div>
        </>
    );
}
